import React from 'react'
import './Cards.css'
import { useEffect,useState } from 'react'
import axios from 'axios'
import img1 from '../images/img1.png'
import img2 from '../images/img2.png'
import img3 from '../images/img3.png'
import img4 from '../images/img4.png'

const Cards =()=> {
    const [cardData,setCardData] = useState([])

    useEffect(async ()=>{
       await axios.get('http://localhost:5000/api/home/')
            .then( res =>{
                setCardData(res.data.videos_data)
                console.log(res.data);


            })
            .catch( err =>{
                console.log(err);
            })
    }, [])

    return (
        <div className="cards-container" id="cards-container">
            <h1 className="title">Our Creations</h1>
            <div className="black-cards-container">
                <div className="card-view">

                    {cardData.map(e =>
                        <div className="card">
                            <img className="card-img" src={img1} alt="img" alt="template"/>
                            <div className="card-title-container"><h1 className="card-title">{}</h1></div>
                            <div className="card-description-container">
                                <p className="card-description">"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua."</p>
                            </div>
                        </div>
                        )}







                    <a href="https://www.youtube.com/channel/UCtxs-UF_cW0zCP123nbHTAw"  target="_blank">
                    <div className="more-cards">
                        <p className="more-cards-txt">MORE</p>
                    </div>
                    </a>

                </div>

            </div>
        </div>
    )
}

export default Cards
